import React from 'react'; //importing react for react components
import './Home.css'

const Home = () => {
  return (
    <div>
      <TopBar/>
    </div>
  );
}

class TopBar extends React.Component {
  render() {
    return (  
    <div class="topbar">
      
    </div>
    );
  }
}


// exporting component so that you can use it in other parts of app
export default Home;
